patch:
diff --git a/src/change.c b/src/change.c
index daf4faed5..a72ca2b15 100644
--- a/src/change.c
+++ b/src/change.c
@@ -1118,7 +1118,14 @@ ins_char_bytes(char_u *buf, int charlen)
 	}
     }

-    newp = alloc(linelen + newlen - oldlen);
+// FIXME: Crash CWE-125: Out-of-bounds Read
+    // Add safety margin to allocation size to prevent buffer overflow
+    int required_size = linelen + newlen - oldlen;
+    if (required_size <= 0) {
+	return;
+    }
+    
+    newp = alloc(required_size + 4);  // Add 4 bytes safety margin
     if (newp == NULL)
 	return;

@@ -1131,7 +1138,6 @@ ins_char_bytes(char_u *buf, int charlen)
     if (linelen > col + oldlen)
 	mch_memmove(p + newlen, oldp + col + oldlen,
 					    (size_t)(linelen - col - oldlen));
-
     // Insert or overwrite the new character.
     mch_memmove(p, buf, charlen);
     i = charlen;
